//nolint:revive,govet,errcheck
package common

import (
	"testing"

	"github.com/stretchr/testify/require"
)

func TestEnum_VTOL_TRANSITION_HEADING(t *testing.T) {
	t.Run("zero", func(t *testing.T) {
		var e VTOL_TRANSITION_HEADING
		e.UnmarshalText([]byte{})
		e.MarshalText()
		e.String()
	})

	t.Run("first entry", func(t *testing.T) {
		enc, err := VTOL_TRANSITION_HEADING_VEHICLE_DEFAULT.MarshalText()
		require.NoError(t, err)

		var dec VTOL_TRANSITION_HEADING
		err = dec.UnmarshalText(enc)
		require.NoError(t, err)

		require.Equal(t, VTOL_TRANSITION_HEADING_VEHICLE_DEFAULT, dec)
	})
}
